import React from "react";
import styled from "styled-components";
import { WholeWrapper, Wrapper } from "../../components/commonComponents";

const Css = () => {
  return (
    <WholeWrapper>
      <Wrapper
        height={`100vh`}
        bgImg={`url("https://4leaf-bird-s3.s3.ap-northeast-2.amazonaws.com/thumb/image1.png")`}
      ></Wrapper>
    </WholeWrapper>
  );
};

export default Css;
